      "full_text" : "At the end of a surging event, basal sliding usually stops. This has another counter-intuitive effect: glacier retreat! This is a result of previous mass loss and the slowdown of mass transport from the top. Only after some time, the glacier recovers to its initial state. 4/n https://t.co/rHl2zzwO9g",
