      "favorited" : false,
      "full_text" : "@AGrinsted Note that although the term \"apparent mass-balance\" is widespread and theoretically accounts for this, none of the models in Farinotti et al 2018 deals with this in a sensible manner. Including OGGM - we are just a bit more direct and just assume that we assume equilibrium ;-)",
